          'Venus has the longest known volcanic mountain range in our solar system, located on the surface of Venus is a massive volcanic mountain range called the "Maxwell Montes." It stretches for about 1,300 kilometers (800 miles) across Venus\'s highland region known as Ishtar Terra.',
          "The Moon is tidally locked with Earth, which means that it always shows the same face towards us.",
